import React from 'react'; 
import HomePage from './pages/HomePage'; 
import NotFoundPage from './pages/NotFountPage';
import ProductListPage from './pages/ProductListPage';
const routes = [
    {
        path:'/',
        exact:true,
        main: ()=> <HomePage/>
    },
    {
        path:'',
        exact:true,
        main: ()=> <NotFoundPage/>
    },
    {
        path:'/products',
        exact:false,
        main: ()=> <ProductListPage/>
    }

]
export default routes
